import React from 'react'

const Form = () => {


  const addInfo = (e) => {
    e.preventDefault()
  }

  return (
    <form onSubmit={addInfo}>
      <label>Name</label>
      <input type="text"></input>
      <label>Age (Years)</label>
      <input type="text"></input>
      <button>Add User</button>
    </form>
  )
}

export default Form
